import React from 'react';
import '../styles/Hockey.css'; // Import the CSS file for styling

const Hockey = () => {
  return (
    <div className="hockey-container">
        <h1>HOCKEY</h1>
      <h2>Welcome to Hockey at Kilifi Sports Hub!</h2>
      <p>Hockey enthusiasts gather at Kilifi Sports Hub to enjoy the thrill of the game on both ice and turf. The hub offers top-notch facilities for hockey training and matches, attracting players and teams from the local community.</p>
      <p>Teams at Kilifi Sports Hub compete in leagues and tournaments, showcasing their skills and teamwork on the field. Experienced coaches provide guidance and support to players, focusing on skill development, strategy, and sportsmanship, ensuring a competitive edge in every game.</p>
    </div>
  );
}

export default Hockey;
